import { exampleData } from "../../Data/list";
import { UpdateCIL } from "../updateCIL";

export function GenerateData(){
    for (let Month = 0; Month != 12; Month++){
        for (let Day = 0; Day != 2; Day++){

            if (Math.random() > 0.5) var newState="Einkommen"
            else var newState="Ausgaben"

            var newAmout = (Math.random() * 100).toFixed(2)

            if (newState === "Einkommen") var newBankBalance = parseFloat(exampleData[exampleData.length-1].bankBalance) + newAmout
            else var newBankBalance = parseFloat(exampleData[exampleData.length-1].bankBalance) - newAmout

            var newData = {id:exampleData.length, state:newState, date:{day:(Math.random()*31).toFixed(0), month:Month+1, year:"2023"}, amount:newAmout, bankBalance:newBankBalance}

            exampleData.push(newData)
            console.log(exampleData[exampleData.length-1].bankBalance + "   ,   " + exampleData[exampleData.length-1].state)
        }
    }

    UpdateCIL()
}
